import React from 'react'
import './Headauto/Headauto.css'
import Background from '%PUBLIC_URL%/logo.png';



var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: `url(${Background})`
};

const Headauto = () => {
  return (
    <div>
        <section class="content">
            <div id="left" style={ sectionStyle }>jjjjjjft</div>
            <div id="center">content</div>
            <div id="right">right</div>
        </section>

    </div>
  )
}

export default Headauto
